#import <Kiwi.h>
#import <Nocilla/Nocilla.h>

#import "SendInfoDelegater.h"

SPEC_BEGIN(SendInfoDelegaterSpec)

#define MOCK_REQUEST_number_10_ExcludeAppKeys_non @"http://tr.applipromotion.com/v2h/ad?number=10&adType=1&excludeAppKeys=&appKey=1234567890&appVer=1.0&os=ios"
#define MOCK_REQUEST_number_10_ExcludeAppKeys_ABCDEFGHIJK @"http://tr.applipromotion.com/v2h/ad?number=10&adType=1&excludeAppKeys=ABCDEFGHIJK&appKey=1234567890&appVer=1.0&os=ios"

#define MOCK_RESPONSE_JSON_2APPS                    @"{ \"ads\": [{\"appKey\": \"ABCDEFGHIJK\",\"appName\": \"アプリ名\",\"appText\": \"このアプリの説明\",\"clickUrl\": \"http://www.yahoo.co.jp\",\"image\": \"data:image/png;base64,iVBORw...\"},{\"appKey\": \"BBBBBBBBBBBBBBBB\",\"appName\": \"アプリ名\",\"appText\": \"このアプリの説明\",\"clickUrl\": \"http://www.yahoo.co.jp\", \"image\": \"data:image/png;base64,iVBORw...\"}], \"status\": \"0\" }"
#define MOCK_RESPONSE_JSON_APP_BBBBBBBBBBBBBBBB     @"{ \"ads\": [{\"appKey\": \"BBBBBBBBBBBBBBBB\",\"appName\": \"アプリ名\",\"appText\": \"このアプリの説明\",\"clickUrl\": \"http://www.yahoo.co.jp\", \"image\": \"data:image/png;base64,iVBORw...\"}], \"status\": \"0\" }"
#define MOCK_RESPONSE_JSON_3APPS                    @"{ \"ads\": [{\"appKey\": \"ABCDEFGHIJK\",\"appName\": \"アプリ1\",\"appText\": \"アプリ1説明\",\"clickUrl\": \"http://www.yahoo.co.jp\",\"image\": \"data:image/png;base64,\"},{\"appKey\": \"BBBBBBBBBBBBBBBB\",\"appName\": \"アプリ2\",\"appText\": \"アプリ2説明\",\"clickUrl\": \"http://www.yahoo.co.jp\", \"image\":\"data:image/png;base64,\"},{\"appKey\": \"CCCCCCCCCCC\",\"appName\": \"アプリ3\",\"appText\": \"アプリ3説明\",\"clickUrl\": \"http://www.yahoo.co.jp\",\"image\": \"https://dl.dropboxusercontent.com/u/180622001/iconAdSample.png\"}], \"status\": \"0\" }"

/**返却JSONサンプル
 {
 "ads": [{
 "appKey": "0123456789ABCDEF",
 "appName": "アプリ名",
 "appText": "このアプリの説明",
 "clickUrl": "http://ad.../v2h/open?ad=...",
 "image": "data:image/png;base64,iVBORw..."
 },
 {
 "appKey": "0123456789ABCDEF",
 "appName": "アプリ名",
 "appText": "このアプリの説明",
 "clickUrl": "http://ad.../v2h/open?ad=...",
 "image": "http://aaaa.com/xxxx.png"
 }
 ],
 "status": "0"
 }
 **/
describe(@"SendInfoDelegater", ^{
    
    beforeAll(^{
        [[LSNocilla sharedInstance] start];
    });
    afterAll(^{
        [[LSNocilla sharedInstance] stop];
    });
    afterEach(^{
        [[LSNocilla sharedInstance] clearStubs];
    });
    
    context(@"3apps in server", ^{
        __block  SendInfoDelegater *delegater;
        
        beforeEach(^{
            delegater = [[SendInfoDelegater alloc] init];
            stubRequest(@"GET", MOCK_REQUEST_number_10_ExcludeAppKeys_non)
            .andReturn(200)
            .withHeaders(@{@"Content-Type": @"application/json"})
            .withBody(MOCK_RESPONSE_JSON_3APPS);
            
            stubRequest(@"GET", MOCK_REQUEST_number_10_ExcludeAppKeys_ABCDEFGHIJK)
            .andReturn(200)
            .withHeaders(@{@"Content-Type": @"application/json"})
            .withBody(MOCK_RESPONSE_JSON_APP_BBBBBBBBBBBBBBBB);
            
            stubRequest(@"GET", @"https://dl.dropboxusercontent.com/u/180622001/ad.json")
            .andReturn(200)
            .withHeaders(@{@"Content-Type": @"application/json"})
            .withBody(MOCK_RESPONSE_JSON_APP_BBBBBBBBBBBBBBBB);
        });
        
        it(@"exclude test", ^{
            __block NSString *isNothingExcludedAppKey;
            [delegater requestAdWithNumberOfAds:10
                               onCompletedBlock:^(NSInteger sts, NSArray *adsArg) {
                                   Info *excludeApp = (Info*)adsArg[0];
                                   __block NSString *excludeAppKey = excludeApp.appKey;
                                   [SendInfoDelegater addExcludeInfo:excludeApp];
                                   
                                   [delegater requestAdWithNumberOfAds:10 onCompletedBlock:^(NSInteger sts, NSArray *ads) {
                                       NSUInteger index = [[ads valueForKeyPath:@"appKey"] indexOfObject:excludeAppKey];
                                       isNothingExcludedAppKey = (index == NSNotFound ? @"YES" : @"NO");
                                       NSLog(@"isNothingExcludedAppKey %@", isNothingExcludedAppKey);
                                       
                                       //                                       it(@"image not nil", ^{
                                       //                                           UIImage *img = [((Ad*)[ads objectAtIndex:0]) getImage];
                                       //                                           [[theValue(img) shouldEventually] beNonNil];
                                       //                                       });
                                   }];
                               }];
            [[expectFutureValue(isNothingExcludedAppKey) shouldEventually] equal:@"YES"]; //○単体で
            //            [[expectFutureValue(isNothingExcludedAppKey) shouldEventually] equal:theValue(@"YES")]; //×単体で
            //            [[expectFutureValue(theValue(isNothingExcludedAppKey)) shouldEventually] equal:theValue(@"YES")]; //○単体で
        });
    });
});

SPEC_END
